INSERT INTO `adminnotification_inbox` VALUES(73, 4, '2011-09-19 12:52:59', 'Check our new Affiliate Suite extension for Magento CE', 'Affiliate Suite by Templates Master will help you to build new efficient sales channe. Your new affiliate partners will be able to promote your store by emailing, placing links, banners and other  media on their sites and any social networks profiles.', 'http://bit.ly/oKa0zd ', 1, 0);
INSERT INTO `adminnotification_inbox` VALUES(74, 4, '2011-10-12 14:02:30', 'Magento Easybanners 1.1 is now available', 'Easybanners provide easy and powerful tools to manage and target banners to specific users. We are proud to announce that this extension provide support for Magento widgets now. So you can place any banner or placeholder right into your cms page. We have also added option to call out placeholders directly in the phtml templates.', 'http://bit.ly/phgpx5', 1, 0);
INSERT INTO `adminnotification_inbox` VALUES(75, 4, '2011-11-04 16:49:59', 'Join us on Facebook and get one time 10% OFF on all our templates and extensions.', 'Join us on Facebook and get one time 10% OFF on all our templates and extensions.', 'http://on.fb.me/rYE7qW ', 1, 0);
INSERT INTO `adminnotification_inbox` VALUES(76, 4, '2011-11-08 16:00:10', 'Affiliate Suite 1.0.5  is now available', 'Affiliate Suite by Templates Master will help you to build new efficient sales channel and start offering affiliate programs at your store.\n\nNew features\n- Allow to copy banners\n- Autoselect default campaign on partner registration\n- Ordered products report interface added\n\nBug fixes\n- Prowidget tool hidden on frontend if disableded', 'http://bit.ly/saXDyk', 1, 0);
