INSERT INTO `adminnotification_inbox` VALUES(81, 4, '2011-11-30 15:22:50', 'Helpmate 1.1 is now available', 'Helpmate 1.1 is now available\n\nFeatures:\n- 2 types of contact form. First is default and second one is like http://www.payoneer.com/contactUs.aspx \n- Attach allowed files from emails\n- Akismet integration\n\nBug fix\n- File upload bug in admin fixed', 'http://bit.ly/teCtnm ', 1, 0);
