INSERT INTO `adminnotification_inbox` VALUES(89, 4, '2012-03-12 16:11:39', 'Mobile Star - Android and iPhone theme for Magento is now available!', 'Don’t loose your chance to keep contact with your customers while they are using their phones. We have created Mobile Star Magento theme that will help you join new e-commerce revolution and build your mobile presence just in 5 minutes. Mobile Star is specially designed Magento theme that will work on iPhone, Android  and any other advanced phone. ', 'http://bit.ly/z5XF3M ', 1, 0);
