INSERT INTO `adminnotification_inbox` VALUES(99, 4, '2012-06-20 18:54:07', 'Magento Community Edition 1.7.0.1 now available! ', 'We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(100, 4, '2012-07-05 19:21:43', 'Important Security Update - Zend Platform Vulnerability', 'We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ', 'http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(101, 4, '2012-08-24 22:37:47', 'Increase Your Sales With PayPal', 'Magento merchants using PayPal Express Checkout can help increase their sales on average 18%. It is one simple thing you can do right now to help boost your sales. Learn more.', 'http://www.magentocommerce.com/add-paypal?utm_source=CEModule&utm_medium=copy&utm_content=18&utm_campaign=choosepaypal', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(102, 4, '2012-06-22 14:22:54', 'Prolabels 2.1 is now available', 'Prolabels 2.1 is now available with next new features and bugfixes:\n\n- Performance update\n- Active products grid interface added for labels\n- Out of stock label text option added\n- Catalog indexes conflict fixed', 'http://bit.ly/LGESFz', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(103, 4, '2012-07-05 14:12:33', 'Firecheckout 2.2 is now available.', 'Fire Checkout 2.2 is now available with great new features:\n\n- 5 custom order fields added\n- Hide other shipping methods, if free is applicable (optional)\n- Nice looking styles on our Mobile Star theme\n- Improved positioning of the popup window and spinner on mobile devices\n- Fixed conflict with Magento''s _canShowForUnregisteredUsers method.\n- In order to improve Fire Checkout compatibility with third party extensions "Enable Agreements" option was removed. Please use Magento standard config option instead. You can find it at the checkout options section.', 'http://bit.ly/N8Cyqi', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(104, 4, '2012-07-25 14:07:32', 'Prolabels 2.2 is now available', 'Prolabels 2.2 is now available with next new features\n\n- Unlimited number of system labels\n- Improved localization for system labels\n', 'http://bit.ly/Qj65pj', 0, 0);
