INSERT INTO `adminnotification_inbox` VALUES(106, 4, '2012-08-09 14:31:48', 'Ajax Pro 2.0  is now available', 'Ajax Pro 2.0  is now available with next new features\n\n- completely refactored extension logic for better performance and better compatibility\n- javascript login form added', 'http://bit.ly/Na3k8u', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(107, 4, '2012-08-17 15:17:07', 'Social Suite 1.2 with Pinterest integration is now available', 'Social Suite 1.2  is now available with next new features\n\n- Pinterest integration\n', 'http://bit.ly/N8Mcu0', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(108, 4, '2012-08-27 14:15:31', 'Ajax Pro 2.0.1 update is now available', 'Ajax Pro 2.0.1  is now available with next new features\n\n- Ajax Pro links and actions disabled for search engines spiders\n', 'http://bit.ly/PVixZE', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(109, 4, '2012-08-30 19:16:37', 'Helpmate 1.2.1 is now available', 'Helpmate 1.2.1  is now available with next new features\n\n- Captcha support for Magento 1.7\n- Frontend layout field label alignment fixed\n- File uploaded type javascript validation added\n- Order info field is now optional\n- Improved admin tickets message format\n\n', 'http://bit.ly/UdSddX', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(110, 4, '2012-09-17 09:56:48', 'Fire Checkout 2.3.1 is now available. Check more details on most advanced  one page checkout for Magento.', 'Fire Checkout 2.3.1 is now available with next new features\n\n- Added check for minimum order amount during cart update\n- Fire Checkout layout updated. Now it has more cleaner place order section.\n- Order review block added for EU countries and overall layout is now fully compatible with recent EU requirements\n- Shopping cart section improved. Product name as link and short products description cab be shown now\n\n', 'http://bit.ly/Prk3Bp', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(111, 4, '2012-09-18 14:26:11', 'Facebook Like Button 2.0 is now available', 'Facebook Like Button 2.0 is now available with next new features\n\n- Allow to place like buttons on categories pages\n- Flexible locale configuration in admin\n- Fixed problems with meta image and description information\n', 'http://bit.ly/QiEL5P', 0, 0);
