INSERT INTO `adminnotification_inbox` VALUES(116, 4, '2012-10-15 14:54:50', 'Firecheckout 2.3.2 is now available ', 'Fire Checkout 2.3.2 is now available with next new features\n\n- Saving delivery date and additional checkout fields when PaypalExpress or similar method is used fixed.\n- Payone integration added\n', 'http://bit.ly/Rx95xd', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(117, 4, '2012-10-18 15:46:49', 'Easy Slider 2.0 with Nivo slider integration is now available', 'Easy Slider 2.0 is now available with next new features\n\n- Nivo slider integration\n- Support 18 Nivo slider effects\n- Responsive design friendly\n- Load jQuery in no-conflict mode', 'http://bit.ly/R2MW7e', 0, 0);
