INSERT INTO `adminnotification_inbox` VALUES(119, 4, '2012-10-31 16:14:53', 'Helpmate 1.3.0 is now available', 'Helpmate 1.3.0  is now available with next new features\n- Allow admins to answer tickets via email gateway\n- WYSIWYG editor is now available in admin ticket interface\n- Optionally display html tags in tickets interface\n\nFixes\n- Fixed issue with error message attached to tickets for disallowed file types\n- Improved email format auto-detect feature\n', 'http://bit.ly/PHeEdJ', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(120, 4, '2012-11-19 20:27:42', 'Wrap up more holiday sales with financing', 'Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.', 'http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(121, 4, '2008-11-08 04:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(122, 4, '2013-01-15 22:02:07', 'Imagine 2013 Registration is Now Open!', 'Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.', 'https://registration.imagineecommerce.com/', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(123, 4, '2013-02-12 17:53:42', 'Get More eCommerce Power with Magento Enterprise', 'Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ', 'http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE', 0, 0);
INSERT INTO `adminnotification_inbox` VALUES(124, 2, '2013-09-27 17:28:13', 'Magento Community Edition 1.8.0.0 - now available for download!', 'Get tax, security, performance, and many other improvements. \n\nLearn more at http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/ ', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/', 0, 0);
