INSERT INTO `cms_page` VALUES(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', '', '<div class="page-head-alt"><h3>Whoops, our bad...</h3></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<br/>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd>\r\n<dd>\r\n<ul class="disc">\r\n<li><a href="#" onclick="history.go(-1);">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br/><a href="{{store url=""}}">Store Home</a><br/><a href="{{store url="customer/account"}}">My Account</a></li></ul></dd></dl><br/>\r\n<p><img src="{{skin url=''images/media/404_callout1.jpg''}}" style="margin-right:15px;"/><img src="{{skin url=''images/media/404_callout2.jpg''}}" /></p>', '2007-06-20 18:38:32', '2007-08-26 19:11:13', 1, 0, NULL, NULL, '', NULL, NULL, NULL);
INSERT INTO `cms_page` VALUES(2, 'Home page', 'one_column', NULL, NULL, 'home', NULL, '<div class="clear"></div>', '2007-08-23 10:03:25', '2013-11-06 18:21:18', 1, 0, '<reference name="head">\r\n            <action method="addItem" ifconfig="sales/msrp/enabled"><type>skin_js</type><name>js/msrp.js</name></action>\r\n</reference>\r\n<reference name="content">\r\n	<block type="cms/block" name="slider_1">\r\n		<action method="setBlockId"><block_id>slider_1</block_id></action>\r\n	</block>\r\n	<block type="cms/block" name="banner_right">\r\n		<action method="setBlockId"><block_id>banner_right</block_id></action>\r\n	</block>\r\n	<block type="cms/block" name="banner_list">\r\n		<action method="setBlockId"><block_id>banner_list</block_id></action>\r\n	</block>\r\n	<block type="core/template" template="catalog/msrp/popup.phtml" name="product.tooltip"></block>\r\n	<block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml">\r\n		<action method="setColumnCount"><columns>4</columns></action>\r\n		<action method="setProductsCount"><count>4</count></action>\r\n		<action method="addPriceBlockType">\r\n		<type>bundle</type><block>bundle/catalog_product_price</block>     \r\n		<template>bundle/catalog/product/price.phtml</template>\r\n		</action>\r\n	</block>\r\n</reference>', NULL, NULL, NULL, NULL, NULL);
